import React, { Component } from "react";
import { connect } from "react-redux";
import { getEmail, getName, getAge } from '../actions'
import "./RegisterCustomers.css";


class RegisterCustomers extends Component {
  toPass() {
    this.props.history.push("/login");
  }

  render() {
    return (
      <div className="background-register">
        <div className="login">
          <fieldset>
            <legend>Preencha os dados para Login</legend>
            <legend className="datas-to-login">Nome</legend>
            <input onChange={({target})=> this.props.get_name(target.value)} placeholder="Digite aqui seu nome" type="text" />
            <legend className="datas-to-login">Idade</legend>
            <input onChange={({target}) => this.props.get_age(target.value)} placeholder="Digite aqui sua Idade" type="password" />
            <legend className="datas-to-login">Email</legend>
            <input onChange={({target}) => this.props.get_email(target.value)} placeholder="Digite aqui seu email" type="password" />
            <a onClick={() => this.toPass()}>Cadastrar Usu√°rio</a>
          </fieldset>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  Email: state.get_Email,
  Idade: state.get_Age,
  Nome: state.get_Name,
});

const mapDispatchToProps = (dispatch) => ({
  get_email: (get_Email) => dispatch(getEmail(get_Email)),
  get_age: (get_Age) => dispatch(getAge(get_Age)),
  get_name: (get_Name) => dispatch(getName(get_Name)),
});

export default connect(mapStateToProps, mapDispatchToProps)(RegisterCustomers);
